//create an enum
const UserActionTypes = Object.freeze({
    SET_CURR_USER: Symbol('set the current user'),
    GOOGLE_SIGNIN_START: Symbol('starting google signin'),
    GOOGLE_SIGNIN_SUCCESS: Symbol('succeded google signin'),
    GOOGLE_SIGNIN_FAILURE: Symbol('failed google signin'),

    EMAIL_SIGNIN_START: Symbol('starting email signin'),
    EMAIL_SIGNIN_SUCCESS: Symbol('succeded email signin'),
    EMAIL_SIGNIN_FAILURE: Symbol('failed email signin'),
});

export default UserActionTypes
